(1, 1, '2015-10-02 14:07:04', '2015-10-02 14:07:04', 'Welcome to WordPress. This is your first post. Edit or delete it, then start writing!', 'Hello world!', '', 'publish', 'open', 'open', '', 'hello-world', '', '', '2015-10-02 14:07:04', '2015-10-02 14:07:04', '', 0, 'http://localhost/srijanalaya/?p=1', 0, 'post', '', 1),
(2, 1, '2015-10-02 14:07:04', '2015-10-02 14:07:04', 'This is an example page. It''s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I''m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin'' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href="http://localhost/srijanalaya/wp-admin/">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'Sample Page', '', 'publish', 'closed', 'open', '', 'sample-page', '', '', '2015-10-02 14:07:04', '2015-10-02 14:07:04', '', 0, 'http://localhost/srijanalaya/?page_id=2', 0, 'page', '', 0),
(4, 1, '2015-10-02 14:07:36', '2015-10-02 14:07:36', '<p>Your Name (required)<br />\n    [text* your-name] </p>\n\n<p>Your Email (required)<br />\n    [email* your-email] </p>\n\n<p>Subject<br />\n    [text your-subject] </p>\n\n<p>Your Message<br />\n    [textarea your-message] </p>\n\n<p>[submit "Send"]</p>\n[your-subject]\n[your-name] <lstrrt@gmail.com>\nFrom: [your-name] <[your-email]>\nSubject: [your-subject]\n\nMessage Body:\n[your-message]\n\n--\nThis e-mail was sent from a contact form on srijanalaya (http://localhost/srijanalaya)\nlstrrt@gmail.com\nReply-To: [your-email]\n\n0\n0\n\n[your-subject]\nsrijanalaya <lstrrt@gmail.com>\nMessage Body:\n[your-message]\n\n--\nThis e-mail was sent from a contact form on srijanalaya (http://localhost/srijanalaya)\n[your-email]\nReply-To: lstrrt@gmail.com\n\n0\n0\nYour message was sent successfully. Thanks.\nFailed to send your message. Please try later or contact the administrator by another method.\nValidation errors occurred. Please confirm the fields and submit it again.\nFailed to send your message. Please try later or contact the administrator by another method.\nPlease accept the terms to proceed.\nPlease fill in the required field.\nThis input is too long.\nThis input is too short.', 'Contact form 1', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2015-10-02 14:07:36', '2015-10-02 14:07:36', '', 0, 'http://localhost/srijanalaya/?post_type=wpcf7_contact_form&p=4', 0, 'wpcf7_contact_form', '', 0),
